where app_id = #{appId,jdbcType=VARCHAR}
  and ente_id = #{enteId,jdbcType=VARCHAR}
  and entryid = #{entryid,jdbcType=VARCHAR}
  and instock_id = #{instockId,jdbcType=VARCHAR}
